  use ol_colourmatrix_ppjjj_gggggg_1_/**/REALKIND, only: colmat_not_initialised, colourmatrix_init
  use ol_forced_parameters_ppjjj_gggggg_1_/**/REALKIND, only: check_forced_parameters
  use ol_heltables_ppjjj_gggggg_1
  use ol_kinematics_/**/REALKIND, only: LC2Std_Rep_cmplx
  implicit none

